import styled from "styled-components";
export const Header = styled.nav`
  background-color: #111;
  color: #fff;
  width: 100%;
  display: flex;
  align-items: center;
  padding: 0px 20px;
  font-size: 16px;
  height: 70px;
  border: none;
  div {
    margin-right: 20px;
    a {
      text-decoration: none;
      color: #b4b4b4 !important;
      padding: 10px 20px;
    }
  }
`;
